{"0": ["Выглядят как бижутерия, помятые, замок не застёгивается, отказ.", "2021-03-05T12:10:56Z", "золотистый", "0", 0, 1, 1, "серьги ", "Серебро России"], "1": ["Очень красивые, застежка работает хорошо, камушки на месте, не поцарапаны", "2021-02-22T08:52:15Z", "золотистый", "0", 8, 0, 5, "Серьги", "Серебро России"], "2": ["Серьги очень красивые. Все камушки на месте. Но, лёгкие, и замочки не держат. Придётся нести к ювелиру и исправлять недостаток. Прошу принять к сведению производителей.", "2021-01-26T06:57:56Z", "золотистый", "0", 2, 0, 4, "Серьги", "Серебро России"], "3": ["Товар приехал мятый.", "2020-12-26T11:46:14Z", "золотистый", "0", 2, 0, 3, "Серьги", "Серебро России"], "4": ["Очень все понравилось! Беру не первый раз: позолота качественная не стирается и не чернеет. Рекомендую производителя!", "2020-12-21T08:41:49Z", "золотистый", "0", 6, 0, 5, "Серьги", "Серебро России"], "5": ["Поставщику должно быть стыдно. Полное неуважение к клиентам! Похоже та же самая бракованная пара сережек приехала теперь ко мне! Замочки погнуты на обеих серьгах. Разочарование полное.", "2020-09-21T06:01:10Z", "золотистый", "0", 1, 0, 1, "Серьги", "Серебро России"], "6": ["Серьги красивые, но погнуты. Конечно отказ. Уберите с продажи неисправный товар.", "2020-08-31T16:49:05Z", "золотистый", "0", 2, 0, 1, "Серьги", "Серебро России"], "7": ["Похоже, что одна и та же пара ездит по стране. Застежка набекрень, потому отказ", "2020-08-03T12:44:13.853796785Z", "золотистый", "0", 2, 0, 1, "Серьги", "Серебро России"], "8": ["Серьги большие, массивные, смотрятся как бижутерия. Может и выкупила бы, но одна сережка была не просто погнута, а сплющена в одну сторону со смещением. Отказ.", "2020-07-06T08:28:05.161415219Z", "золотистый", "0", 1, 0, 1, "Серьги", "Серебро России"], "9": ["Серьги пришли в безобразном виде! На одной серёжке замок не открывается,а на второй так и вовсе свёрнут в бок,как- будто на него наступили.Не понятно как можно в таком виде присылать покупателю.\nСами серьги очень симпатичные.Я расстроена,хотела сделать маме подарок.", "2020-05-31T07:56:09.406058426Z", "золотистый", "0", 5, 0, 2, "Серьги", "Серебро России"], "11": ["Нормальные , замки работают , как уши будут реагировать - пока не понятно ! Но в целом довольна ! ", "2020-05-13T13:15:04.862960735Z", "золотистый", "0", 3, 0, 5, "Серьги", "Серебро России"], "13": ["Мне понравились.", "2020-01-16T14:37:52.363215638Z", "золотистый", "0", 25, 1, 5, "Серьги", "Серебро России"], "14": ["Красивые сережки легкие,  оригинально смотрятся за счет фактурности металла.", "2020-01-13T14:27:04.616168562Z", "золотистый", "0", 4, 0, 5, "Серьги", "Серебро России"]}
